// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "./CoreCellControls.sol";
import "./CoreGridMining.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";

contract GridCore is CoreGridMining, ERC721Holder {
    /// @dev Calculate the number of circulating GRID tokens
    /// The token contract calculates all minted tokens minus all sent to the burn address
    /// Here we also subtract any minted but unclaimed tokens from that total
    function getGridTokenCirculatingSupply() external view returns (uint256 _circulatingAmount) {
        require(address(gridTokenContract) != address(0), "gridTokenContract has not been set");

        _circulatingAmount = gridTokenContract.getCirculatingSupply();

        uint256 _unclaimedSupply = gridTokenContract.balanceOf(address(this));

        if (_circulatingAmount > _unclaimedSupply){
            _circulatingAmount = _circulatingAmount - _unclaimedSupply;
        } else {
            _circulatingAmount = 0;
        }

        return _circulatingAmount;
    }

    /// @dev Create a new CELL token in the Grid, with specific properties
    /// @param _cellId - ID of the CELL changing teams
    /// @param _newTeam - ID of the CELL's new team
    function setTeam(uint256 _cellId, uint8 _newTeam) external {
        require(address(cellContract) != address(0), "cellContract has not been set");

        address _owner = cellContract.ownerOf(_cellId);
        require (msg.sender == _owner, "Only a CELL's owner can change its team");

        //claim earned tokens before team change
        claimGridTokens(_cellId);
        
        //now update the team
        cellContract.setTeam(_cellId, _newTeam);
    }

    /// @dev Ensure payments can only be made from expected sources
    receive() external payable {
        require (
            msg.sender == address(cellClockAuctionContract) ||
            msg.sender == address(gridTokenContract), 
            "You should not be paying into the core contract"
        );
    }
}

